  static EapiParams paramsDecrypt(String encryptedParams) {
    final message = utf8.encoder.convert(
      AesCrypto.decrypt(
        Uint8List.fromList(encryptedParams.base16decode()),
        utf8.encode(key),
        mode: AesMode.ecb,
      ),
    );
    return EapiParams.fromDecrypted(utf8.decoder.convert(message));
