    return bytes2hex(md5(utf8.encode(string)));
  }

  static Uint8List md5(Uint8List bytes) {
    return MD5Digest().process(bytes);
  }

  static String base16Encode(List<int> bytes, {bool upperCase = false}) {
    if (bytes.isEmpty) {
      return "";
    }

